import MyDocument from "../pages/_document"

const Globals = styled.div`
  font-family: "Advent Pro", sans-serif;
  /* font-size: 5rem; */
`

const IndexPage = () => {
  return (
    <Globals>
      <div>COVID-19</div>
      <Stats url="https://covid19.mathdro.id/api/" />
